import React from "react";
import Text from "../components/text";
import Container from "../components/container";

const Index = () => (
  <>
    <Container>
      <Text>안녕, Next.js</Text>
    </Container>
    <style jsx>{`
      body {
        display: flex;
        justify-content: center;
        align-items: center;
      }
    `}</style>
  </>
);

export default Index;
